function spinner(mode) {
  var mainContainer = document.querySelector('.main-container');
  var spinner = document.querySelector('.spinner');
  if (mode === 'load') {
    // console.log('spinner load')
    spinner.classList.add('fadeout');
    mainContainer.classList.remove('opacity');
  } else if (mode === 'show') {
    // console.log('spinner show')
    spinner.classList.remove('fadeout');
    mainContainer.classList.add('opacity');
  } else if (mode === 'hide') {
    // console.log('spinner hide')
    spinner.classList.add('fadeout');
    mainContainer.classList.remove('opacity');
  }
}

function loadjsfile(url) {
  var el = document.querySelectorAll("script[src='" + url + "']");
  return new Promise(function (resolve, reject) {
    if (!el.length) {
      var script = document.createElement('script');
      // script.setAttribute("type", "text/javascript")
      script.setAttribute('src', url);
      script.setAttribute('data-timestamp', +new Date());
      script.onload = resolve;
      script.onerror = reject;
      // script.src = url;
      if (typeof script !== 'undefined') {
        document.getElementsByTagName('head')[0].appendChild(script);
      }
    } else {
      resolve();
    }
  });
}

function jsonp(url, callback) {
  var callbackName = 'jsonp_callback_' + Math.round(100000 * Math.random());
  window[callbackName] = function (data) {
    delete window[callbackName];
    document.body.removeChild(script);
    callback(data);
  };
  var script = document.createElement('script');
  script.src = url + (url.indexOf('?') >= 0 ? '&' : '?') + 'callback=' + callbackName;
  script.onerror = function (err) {
    delete window[callbackName];
    document.body.removeChild(script);
    callback(null);
  };
  document.body.appendChild(script);
}

function loadcssfile(url) {
  var el = document.querySelectorAll("link[href='" + url + "']");
  return new Promise(function (resolve, reject) {
    if (!el.length) {
      var link = document.createElement('link');
      link.setAttribute('rel', 'stylesheet');
      link.setAttribute('type', 'text/css');
      link.setAttribute('href', url);
      link.setAttribute('data-timestamp', new Date());
      link.onload = resolve;
      link.onerror = reject;
      if (typeof link !== 'undefined') {
        document.getElementsByTagName('head')[0].appendChild(link);
      }
    } else {
      resolve();
    }
  });
}

function notify(message) {
  var time = arguments.length > 1 && arguments[1] !== undefined ? arguments[1] : 1800;

  var sidebarTop = document.querySelector('.Sidebar-top');
  var mainContainer = document.querySelector('.main-container');
  var appContainer = document.querySelector('.app-container');
  sidebarTop.innerText = message;

  // mainContainer.classList.add('opacity')
  // appContainer.classList.remove('show-nav-left', 'show-nav-right', 'show-nav-bottom')
  // appContainer.classList.add('show-nav-top')

  // setTimeout(function () {
  // 	mainContainer.classList.remove('opacity')
  // 	appContainer.classList.remove('show-nav-top', 'show-nav-left', 'show-nav-right', 'show-nav-bottom')
  // }, 1800)

  return new Promise(function (resolve) {
    // dont use reject
    mainContainer.classList.add('opacity');
    appContainer.classList.remove('show-nav-left', 'show-nav-right', 'show-nav-bottom');
    appContainer.classList.add('show-nav-top');
    setTimeout(function () {
      appContainer.classList.remove('show-nav-top');
      mainContainer.classList.remove('opacity');
      appContainer.classList.remove('show-nav-top', 'show-nav-left', 'show-nav-right', 'show-nav-bottom');
      resolve();
    }, time);
  });
}

function changeUpdate(selector, fnc, time) {
  var typingTimer;
  var doneTypingInterval = time || 1500;
  var el = document.querySelector(selector);

  el.addEventListener('keyup', function (event) {
    // event.stopImmediatePropagation()
    clearTimeout(typingTimer);
    typingTimer = setTimeout(fnc, doneTypingInterval);
  });
  el.addEventListener('keydown', function (event) {
    // event.stopImmediatePropagation()
    clearTimeout(typingTimer);
  });
}

function scrollTo(element, to, duration) {
  if (duration <= 0) return;
  var difference = to - element.scrollTop;
  var perTick = difference / duration * 10;

  setTimeout(function () {
    element.scrollTop = element.scrollTop + perTick;
    if (element.scrollTop === to) return;
    scrollTo(element, to, duration - 10);
  }, 10);
}

function filters(content) {
  content = content.replace('http://', 'https://');
  content = content.replace(/<script>.*<\/script>/gi, '');
  content = content.replace('<script>', '');
  content = content.replace('</script>', '');
  content = content.replace(/(?:https:\/\/)?(?:www\.)?(?:youtube\.com|youtu\.be)\/(?:watch\?v=)?(.+)/g, '<div class="video-container"><iframe src="https://www.youtube.com/embed/$1" frameborder="0" allowfullscreen></iframe></div>');
  content = content.replace(/(?:https:\/\/)?(?:www\.)?(?:vimeo\.com)\/(.+)/g, '<div class="video-container"><iframe src="//player.vimeo.com/video/$1" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe></div>');
  content = content.replace(/\[jsfiddle\](.*?)\[\/jsfiddle\]/g, '<iframe width="100%" height="300" src="//jsfiddle.net/estebanrfp/$1/embedded/" allowfullscreen="allowfullscreen" frameborder="0"></iframe>');
  content = content.replace(/\[codepen\](.*?)\[\/codepen\]/g, '<iframe height="265" scrolling="no" src="//codepen.io/estebanrfp/embed/$1/?height=265&theme-id=light&default-tab=js,result&embed-version=2" frameborder="no" allowtransparency="true" allowfullscreen="true" style="width: 100%;"></iframe>');
  return content;
}

